function swFile(e){let l=e.parentElement,t=l.parentElement,n=l.getElementsByClassName("subdiv");for(let e=0;e<n.length;e++){let l=n[e].classList;if(l.value.split(" ").includes("onoff"))l.remove("onoff");else{let e=t.getElementsByClassName("subdiv");for(let l=0;l<e.length;l++)e[l].classList.remove("onoff");l.add("onoff")}}}function hideall(){let e=document.getElementsByClassName("subdiv");for(let l=0;l<e.length;l++){let t=e[l].classList;t.value.split(" ").includes("onoff")&&t.remove("onoff")}}function isMenuOn(e){let l=e.parentElement.parentElement.getElementsByClassName("subdiv");for(let e=0;e<l.length;e++)if(l[e].classList.value.split(" ").includes("onoff"))return!0;return!1}function showsubmenu(e){isMenuOn(e)&&swFile(e)}